import mongoose from "mongoose";
import express from "express";

const app = express();

mongoose.connect("mongodb://localhost:27017/chat", { useNewUrlParser: true });

app.get("/", (_: any, res: any) => {
    res.send("Hello World");
});

app.listen(3000, () => {
    console.log("port 3000");
})
